import { Link } from 'react-router-dom';
import NavMain from './NavMain';
import logo from '../images/moogleLogo.svg';

function Header() {
    return (
        <header>
            <div className="line"></div>
            <Link to="/">
                <img src={logo} alt="Logo" className="logo" />
            </Link>

            <NavMain />
        </header>
    )
}

export default Header;
